import React from "react";

function Projects() {
  return (
    <section data-aos="zoom-in">
      <h2>Projects</h2>
      <ul>
        <li><strong>Student Room Rental System</strong> – A full-stack web platform built with Ruby on Rails, PostgreSQL, Bootstrap.</li>
        <li><strong>Edfluent QA</strong> – Conducted testing and optimization for an English proofreading platform.</li>
      </ul>
    </section>
  );
}

export default Projects;
